  getInitialCoordinatesSuccess,
  getInitialCoordinatesFailure,
  GET_INITIAL_COORDINATES,
} from 'actions/dashboardAction';

function* getInitialCoordinatesFunction() {
  try {
    yield fetch('../testt.txt')
    .then(function(response){
      return response.text();
    }).then(function(data) {
      console.log(data);
    });

    //if (data && data.length > 0) {
      /*const moviesData: MoviesAllDataContentType = {
        movies: data,
        categories: getMoviesCategories(data),
      }*/
    //  yield put(getInitialCoordinatesSuccess())
    //} else {
    //  yield put(getInitialCoordinatesFailure());
    //}
  } catch (e) {
    yield put(getInitialCoordinatesFailure());
  }
}

export default function* dashboardSaga() {
  yield takeLatest(GET_INITIAL_COORDINATES, getInitialCoordinatesFunction);
}
